0-kopiya-_1_-_1_-_1_-_1_.webp";s:26:"specialist_detail_schedule";s:75:"/upload/resize_cache/main/904/320_436_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:31:"webp_specialist_detail_schedule";s:79:"/upload/resize_cache/main/904/320_436_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:20:"slider_photo_preview";s:75:"/upload/resize_cache/main/904/438_264_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:25:"webp_slider_photo_preview";s:79:"/upload/resize_cache/main/904/438_264_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:17:"slider_popup_full";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:22:"webp_slider_popup_full";s:80:"/upload/resize_cache/main/904/1024_787_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";}s:8:"position";s:161:"Главный врач, врач уролог-андролог высшей категории, доктор медицинских наук, профессор";s:4:"text";s:183:"Здравствуйте. Вы не задали вопрос, но, похоже, что Вам следует обратиться к урологу за консультацией.";s:5:"files";s:0:"";s:4:"date";s:24:"29 сентября 2019";s:13:"specialist_id";s:2:"13";}}i:32554;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/32554/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:10:"Павел";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:870:"Добрый вечер! Ещё с начала подросткового возраста как на яичках, так и на обратной стороне члена (обратной всмысле на той, которая находится ближе всего к яичкам) появлялись маленькие белые прыщики. Никакого дискомфорта они не приносили и не приносят, их очень много.
Читал в интернете, говорят либо плохая гигиена была, либо так у всех подростков (временно), и потом они уходят.
