Это вариант нормы. ";s:5:"files";s:0:"";s:4:"date";s:17:"5 марта 2020";s:13:"specialist_id";s:0:"";}}i:46928;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/46928/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:8:"Иван";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:6672:"Извините за грубое сообщение.  Если уже слишком поздно, вы можете ответить после завтра, просто отправьте текстовое сообщение прямо сейчас, чтобы не забыть.  Я хотел бы объяснить все, что мы делали в тот день, я чувствую, что не объяснил это ясно ...
 Мы все встретились в летнем лагере и посмотрели видео, которое пытались скопировать, и именно то, что мы сделали: мы вставляли его, а также брали в рот, девушка взяла мой член в рот, и, пока мы копировали, я также лизнул ее влагалище
 Также был мальчишка, с которым мы делали тот же персонал, с которым мы облизывали пенисы друг друга, поэтому я сделал это с мальчиком, а другие мальчики сделали это со мной, «понравился мой пенис», мы сделали это как игру «камень-ножницы-бумага», кто проигрывает  сделать минет.
 Мы, мальчики, девочки, и мы все также любили задницы друг друга и занимались анальным сексом с другими мальчиками, поэтому они засунули это мне в задницу, а я засунул свой пенис в их задницу «я и другие мальчики занимались лизанием и анальным сексом», и мы делали это повсюду  как 4 раза малышка с примерно 2 месяцами или 3 месяцами каждый раз, когда мы встречались ...
 Еще я занимался вагиниальным сексом с девушкой ...
 Они пригласили меня и сказали, что это хорошо, и я должен это сделать, и сказали, чтобы я попробовал, потому что я совсем не хотел ..
 Но потом мы делали это много раз после мэби, как мы, когда встречаем Агиана в лагере или других местах ...
 Опять же, все время мне было противно, и после того, как я начал узнавать о венерических заболеваниях, я действительно забеспокоился ...
 Я пытался вспомнить, детка, у девушки, которая сделала мне минет, было что-то или какой-то кровоточащий посох во рту
 Или любую влагалищную жидкость
 Или когда кто-то втянул свои сосны мне в задницу, у них были какие-то прекамы?  Или лицензировал его зараженной салливой, кровью
 Так же, как когда я лизал вагину девушки, я мог что-то получить в рот
 Или, когда я сделала парню минет, у меня была кровь из рта, а у него была жидкость для тела или инфицированная кожа ...
 Мы встречались много раз и работали с одним и тем же составом
 И теперь я пытаюсь вспомнить, что именно мы делали, и если бы у нас были биологические жидкости и малышка, они могли бы связаться с этим от кого угодно, или если бы они занимались сексом с инфицированным человеком ...
 Я говорю это, потому что это так странно, что я был таким маленьким, и я делал этот отвратительный персонал, что довольно странно, особенно анал с мальчиками, лизанием и другим персоналом, я говорил вам там, даже если мы встречались много раз, занимались аналом (самый рискованный секс)  оральный секс, вагиниальный секс
 Он все еще довольно низкий?
 Потому что, насколько я знаю, если у вас есть гонорея, хламидия или герпес в определенной части тела, потребуется специальный мазок из анального отверстия или другой части тела.
 Также я не тестировал на другие гепатиты, мне нужно об этом беспокоиться?
 И ты думаешь, даже если бы у них было что-нибудь, я бы не смог этого понять
 И как вы думаете, могло ли это быть в то время, когда были 1 мальчик 10 лет, девочка 10 лет, я и мальчик 12 лет ...
 Мы сделали это снаружи в
 самодельный дом
 Извините за то, что сказал вам, что мне очень странно, что я делал это в детстве, и я верю вам, я действительно устал держать это в себе, я был таким тупым и молодым.
 Все, что мы сделали, это из-за интереса
 Но есть ли шанс на анальные венерические заболевания?
 Или любые другие гапатиты
 Также я помню, что я не ходил в ванную примерно за 15 минут до того, как снова пошел туда для сбора мочи для анализа, так что это не будет так точно?
 Большое спасибо, доктор!
 И снова извините за большое сообщение (просто не мог сказать вам все время, когда мы встречались)";s:5:"files";s:33:"Прикреплены файлы";s:4:"date";s:22:"25 октября 2021";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";N;s:5:"files";s:0:"";s:4:"date";s:22:"25 октября 2021";s:13:"specialist_id";s:0:"";}}}s:4:"path";s:18:"/patients/consult/";}}';
